  proxyDidRespond(proxyResponse) {
    let { response, key } = proxyResponse;
    switch (key) {
      case 'GetStepList':
        if (response.success) {
          this.data = response.value;
          this.designer = new BpmnModeler({
            container: '#canvas',
            propertiesPanel: {
              parent: '#properties'
            },
            additionalModules: [propertiesPanelModule, accountingPropertiesProviderModule, paletteProvider, paletteDraw, paletteContext, popupMenu],
            moddleExtensions: {
              accounting: accountingModdleDescriptor
            },
            data: { nodeList: this.data },
            context: this.props.context

          });

          this.importXML(this.props.xmlDiagram, this.designer);
        }
        break;

      default:
        break;
    }
  }

  saveSVG(done) {
    this.designer.saveSVG(done);
  }

  saveDiagram(done) {
    this.designer.saveXML({ format: true }, function (err, xml) {
      done(err, xml);
    });
  }

  setEncoded(link, name, data) {
    var encodedData = encodeURIComponent(data);

    if (data) {
      link.addClass('active').attr({
        href: 'data:application/bpmn20-xml;charset=UTF-8,' + encodedData,
        download: name
      });
    } else {
      link.removeClass('active');
    }
  }

  createNewDiagram() {
    this.openDiagram(this.props.xmlDiagram);
  }

  openDiagram(xml) {
    this.designer.importXML(xml, err => {
      if (err) {
        console.error(err);
      } else {
        // container
        //   .removeClass('with-error')
        //   .addClass('with-diagram');
      }
    });
  }

