  handleOnSVGClick() {
    var downloadSvgLink = $('#js-download-svg');
    this.saveSVG((err, svg) => {
      this.setEncoded(downloadSvgLink, 'diagram.svg', err ? null : svg);
    });
  }

  readFile(file, done) {
    if (!file) {
      return done(new Error('no file chosen'));
    }

    var reader = new FileReader();

    reader.onload = function (e) {
      done(null, e.target.result);
    };

    reader.readAsText(file);
  }

  handleFileInputChange(e, results) {
    results.forEach(result => {
      const [e] = result;

      let fileData = e.target.result.split(',').pop();
      var m = b64toBlob(fileData);

      this.readFile(m, (err, xml) => {
        if (err) {
          alert('could not read file, see console');
          return console.error('could not read file', err);
        }

        this.openDiagram(xml);
      });
    });
  }

  handleOnNewDiagramClick() {
    this.createNewDiagram();
  }

